import React, { useState, useEffect } from 'react'
import './App.css'

function App() {
  
   const [data, setData] = useState([{}])

   useEffect(()=>{
         fetch("/homepage").then(
            res => res.json()
         ).then(
               data => {
                  setData(data)
                  console.log(data)
               }
         )
      }, [])

    return (
    <div>
         <div style={{ float: 'left', width: "50%" }}>
            <h2 style={{ fontSize: 40 , textAlign: 'center' }}> Secure your most important information with</h2>
            {(typeof data.title ==='undefined') ? (
                  <h1>Undefined</h1>
               ):(
                     data.title.map((title,i) => (
                        
                        <h1 style={{ fontSize: 70 , textAlign: 'center'}} key ={0}>{title}</h1>
                        ))
                        )}
         </div>
         <div style={{ float: 'left', width: "50%", }} id="loginWidget">
            <h1 style={{ top: "50%", fontSize: 60 , textAlign: 'center' }}> Sign In</h1>
               
               <label>
                  <input style={{alignItems: "center", width: "300px", height: "35px", fontSize: 16, borderWidth: 1, borderRadius: 12, paddingHorizontal: 15}} name="userName" />
               </label>
               <br></br>
               <br></br>
               <br></br>
               <label>
                  <input type = "password" style={{ width: "300px", height: "35px", fontSize: 16, borderWidth: 1, borderRadius: 12, paddingHorizontal: 15}} name="userName" />
               </label>
         </div>
    </div>
  )
}

export default App
